RobotMoveSet::~RobotMoveSet()
{
}

std::vector<HitCollider>* RobotMoveSet::GetHitboxes(int MoveId, int FrameNum)
{
	return &Hitboxes[MoveId][FrameNum];
}

std::array<HurtCollider, 6>* RobotMoveSet::GetHurtboxes(int MoveId, int FrameNum)
{
	return &Hurtboxes[MoveId][FrameNum];
}

std::vector<Vector2>* RobotMoveSet::GetSkelPoints(int MoveId, int FrameNum)
{
	return &SkelPoints[MoveId][FrameNum];
}

int RobotMoveSet::GetLandingLag(int MoveId)
{
	return LandingLag[MoveId];
}

int RobotMoveSet::GetMoveLength(int MoveId)
{
	return SkelPoints[MoveId].size();
}

int RobotMoveSet::GetAttackSoundLength(int AttackId)
{
	return AttackSoundLengths[AttackId];
}

int RobotMoveSet::GetMoveSoundLength(int MoveId)
{
	return MoveSoundLengths[MoveId];
}
